import React, { Component } from 'react';
import { Post } from '../components/Post';
import { getAllPosts } from '../store/actions/PostAction';
// redux
import { connect } from 'react-redux'

class home extends Component {
	componentDidMount() {
	    return this.props.getAllPosts();
	}
    render() {
		const posts = componentDidMount();
	    return (
		    <div> 
		        <Post posts={posts}/>
		    </div>
	    );
	}

}

const mapStatesToProps = (state) => {
	return { 
		    postResponse:state.post.postResponse
		};
}

const mapDispatchToProps = (dispatch) => {
	return {
		getAllPosts:() => dispatch(getAllPosts())
	}
}

export default connect(mapStatesToProps, mapDispatchToProps)(home)
